import { Pages } from '../models'
import { factory } from '@flashcards/client'

const getPageDependencies = (pageDisplayName?: string) => {
  switch (pageDisplayName) {
    case Pages.Login:
      return {
        loginWithProvider: factory.createLoginWithProvider(),
      }
    case Pages.Home:
      return {
        getTopics: factory.createGetTopics(),
        addTopic: factory.createAddTopic(),
      }
    default:
      return {}
  }
}

export { getPageDependencies }
